webpackJsonp([0x7ebb4187d78b],{5310:function(e,n){e.exports={data:{markdownRemark:{html:"<h2>Inner Product Spaces</h2>\n<h3>Introduction</h3>\n<p>Let V be a vector space over field F. An inner product is a function that assigns to every ordered pair of vector x and y in V, a scalar in F, denoted by &#x3C;x,y> such that for all x,y in V and a in F these hold:</p>\n<ul>\n<li>&#x3C;x+z,y>=&#x3C;x,y>+&#x3C;x,z></li>\n<li>&#x3C;ax,y>=a&#x3C;x,y></li>\n<li>&#x3C;X,Y>=&#x3C;y,x> (X and Y denote conjugate of x and y respectively)</li>\n<li>&#x3C;x,x>=0 for all x!=0</li>\n</ul>",fields:{slug:"/mathematics/linear-algebra/inner-product-spaces/"},frontmatter:{title:"Inner Product Spaces"}}},pathContext:{slug:"/mathematics/linear-algebra/inner-product-spaces/"}}}});
